                <div style={{
                    display: 'flex',
                    flexDirection: 'row',
                    backgroundColor: '#EDEAEA',
                    justifyContent: 'center',
                }}>
                    <div>
                        <Avatar></Avatar>
                    </div>
                    <p>Alexandre Silva</p>
                </div>

                        <Assistant></Assistant>
                    </div>

        )
    }
}

export default Students;
